#!/bin/python3
import time

'''
  Given two string a and b
  determine if it's possible to make a equal to b by
    1. Capitalize zero or more of a's lowercase letters.
    2. Delete all of the remaining lowercase letters in a.
  :param a: String 1
  :type a: str
  :param b: String 2
  :type b: str
  :return: YES or NO, indicating whether a can be converted to b
  :rtype: str
'''

def abbreviation(a, b):
  b_list = [(v,k) for v, k in enumerate(b)]
  a_list = list(a)
  parsed_list = []
  while(len(a_list) > 0):
    if(len(b_list) > 0 and len(a_list) > 1 and a_list[0].islower() and a_list[1].isupper() and a_list[0].upper() == a_list[1] and b_list[0][1] == a_list[0].upper()):
      a_list.pop(0)
    elif(len(b_list) > 0 and b_list[0][1] == a_list[0].upper()):
      parsed_list.append(b_list.pop(0))
      a_list.pop(0)
    elif(a_list[0].islower()):
      a_list.pop(0)
    elif(a_list[0].isupper()):
      break

  if(len(a_list) == 0 and len(b) == len(parsed_list)):
    return 'YES'
  else:
    return 'NO'
    

